window.bookSummaryJSON = "<p>My name is Nilsa. </p> <p>I am the Shadow of the Moon. </p> <p>A lunar witch. </p> <p>A divine assassin. </p> <p>And they will tell you that I am a traitor. </p> <p>Framed for the murder of my own high priestess and with nowhere else to go, I'm forced to seek refuge amongst pirates. This mismatched crew of immortal males thinks I'm a solar witch; a harmless, goody-two-shoes, celibate priestess of life. </p> <p>But it's hard to keep up the charade with a cursed fae, two broken shifters and an overprotective vampire tempting me at every turn. </p> <p>It's even harder when I have to constantly restrain the urge to murder their asshole captain. </p> <p> All I need to do is live long enough to exact vengeance and reclaim my place in my coven. There's no place for men in my life. Not even the siren haunting my dreams who claims I'm his mate.</p>"; 
